import React from "react";
import SpaceCard from "./SpaceCard";

function SpaceContainer({ spaces}) {
  return (
    <main>
      <ul className="cards">
        {/* <SpaceCard spaces={spaces} /> */}
        {spaces.map((space) => (
          <SpaceCard
            key={space.id}
            space={space}

          />
        ))}
      </ul>
    </main>
  );
}

export default SpaceContainer;
